INSERT INTO disciplina VALUES (1, 'Portugu√™s', 'A <b>l√≠ngua portuguesa</b>, tamb√©m designada portugu√™s, √© uma l√≠ngua rom√¢nica flexiva ocidental originada no galego-portugu√™s falado no Reino da Galiza e no norte de Portugal. Com a cria√ß√£o do Reino de Portugal em 1139 e a expans√£o para o sul como parte da Reconquista deu-se a difus√£o da l√≠ngua pelas terras conquistadas e mais tarde, com as descobertas portuguesas, para o Brasil, √Åfrica e outras partes do mundo.[3] O portugu√™s foi usado, naquela √©poca, n√£o somente nas cidades conquistadas pelos portugueses, mas tamb√©m por muitos governantes locais nos seus contatos com outros estrangeiros poderosos. Especialmente nessa altura a l√≠ngua portuguesa tamb√©m influenciou v√°rias l√≠nguas.', '', 40);
INSERT INTO disciplina VALUES (2, 'Matem√°tica', 'A <b>matem√°tica</b> √© a ci√™ncia do racioc√≠nio l√≥gico e abstrato, que estuda quantidades, medidas, espa√ßos, estruturas, varia√ß√µes e estat√≠sticas. Um trabalho matem√°tico consiste em procurar por padr√µes, formular conjecturas e, por meio de dedu√ß√µes rigorosas a partir de axiomas e defini√ß√µes, estabelecer novos resultados. A matem√°tica desenvolveu-se principalmente na Mesopot√¢mia, no Egito, na Gr√©cia, na √çndia e no Oriente M√©dio. A partir da Renascen√ßa, o desenvolvimento da matem√°tica intensificou-se na Europa, quando novas descobertas cient√≠ficas levaram a um crescimento acelerado que dura at√© os dias de hoje', NULL, 20);
INSERT INTO disciplina VALUES (3, 'F√≠sica', '<b>F√≠sica</b> √© a ci√™ncia que estuda a natureza e seus fen√¥menos em seus aspectos mais gerais. Analisa suas rela√ß√µes e propriedades, al√©m de descrever e explicar a maior parte de suas consequ√™ncias. Busca a compreens√£o cient√≠fica dos comportamentos naturais e gerais do mundo em nosso torno, desde as part√≠culas elementares at√© o universo como um todo.[1][2] Com o amparo do m√©todo cient√≠fico e da l√≥gica, e tendo a matem√°tica como linguagem natural, esta ci√™ncia descreve a natureza atrav√©s de modelos cient√≠ficos. √â considerada a ci√™ncia fundamental, sin√¥nimo de ci√™ncia natural: as ci√™ncias naturais, como a qu√≠mica e a biologia, t√™m ra√≠zes na f√≠sica. Sua presen√ßa no cotidiano √© muito ampla, sendo praticamente imposs√≠vel uma complet√≠ssima descri√ß√£o dos fen√¥menos f√≠sicos em nossa volta. A aplica√ß√£o da f√≠sica para o benef√≠cio humano contribuiu de uma forma inestim√°vel para o desenvolvimento de toda a tecnologia moderna, desde o autom√≥vel at√© os computadores qu√¢nticos.', NULL, 120);
INSERT INTO disciplina VALUES (4, 'Qu√≠mica', 'Qu√≠mica √© a ci√™ncia que estuda a composi√ß√£o, estrutura, propriedades da mat√©ria, as mudan√ßas sofridas por ela durante as rea√ß√µes qu√≠micas e a sua rela√ß√£o com a energia.[2][3]. √â considerada uma ci√™ncia exata e √© chamada muitas vezes de ci√™ncia central porque √© a ponte entre outras ci√™ncias naturais[4][nota 2] como F√≠sica, Matem√°tica e Biologia. A Qu√≠mica possui papel fundamental no desenvolvimento tecnol√≥gico, pois a utiliza√ß√£o dos conceitos e t√©cnicas dessa ci√™ncia permite a obten√ß√£o de novas subst√¢ncias, al√©m de preocupar-se com a preven√ß√£o de danos e explora√ß√£o sustent√°vel do meio ambiente.', NULL, 30);
INSERT INTO disciplina VALUES (5, 'Biologia', 'Biologia √© a ci√™ncia que estuda a vida e os organismos vivos.[1][2] A biologia est√° dividida em v√°rios campos especializados que abrangem a morfologia, fisiologia, anatomia, comportamento, origem, evolu√ß√£o[2][3] e distribui√ß√£o da mat√©ria viva, al√©m dos processos vitais e das rela√ß√µes entre os seres vivos.[1][4] As subdisciplinas da biologia s√£o definidas pela escala em que a vida √© estudada, os tipos de organismos estudados e os m√©todos utilizados para estud√°-los: a bioqu√≠mica examina a qu√≠mica rudimentar da vida; a biologia molecular estuda as intera√ß√µes complexas entre as mol√©culas biol√≥gicas; a biologia celular examina o bloco b√°sico de constru√ß√£o de toda a vida, a c√©lula; a fisiologia examina as fun√ß√µes f√≠sicas e qu√≠micas dos tecidos, √≥rg√£os e sistemas de √≥rg√£os; a ecologia examina como os organismos interagem em seu ambiente; e a biologia evolutiva examina os processos evolutivos que provavelmente produziram a diversidade da vida.[5] Apesar do amplo escopo e da complexidade da ci√™ncia, existem certos conceitos unificadores que o consolidam em um √∫nico campo coerente. Geralmente, a biologia reconhece a c√©lula como a unidade b√°sica da vida, os genes como a unidade b√°sica da hereditariedade, e a evolu√ß√£o como o motor que impulsiona a cria√ß√£o de novas esp√©cies.', NULL, 20);
INSERT INTO disciplina VALUES (6, 'Geografia', 'A Geografia √© uma ci√™ncia que tem por objetivo o estudo da superf√≠cie terrestre e a distribui√ß√£o espacial de fen√¥menos significativos na paisagem. Tamb√©m estuda a rela√ß√£o rec√≠proca entre o homem e o meio ambiente (Geografia Humana). Para alguns a Geografia tamb√©m pode ser uma pr√°tica humana de conhecer onde se vive para compreender e planejar o espa√ßo onde se vive. Um dos temas centrais da geografia √© a rela√ß√£o homem-natureza. A natureza √© entendida aqui como as for√ßas que geraram ou contribuem para moldar o espa√ßo geogr√°fico, isto √©, a din√¢mica e intera√ß√µes que existem entre a atmosfera, litosfera, hidrosfera e biosfera. O homem √© entendido como um organismo capaz de modificar consideravelmente as for√ßas da natureza atrav√©s da tecnologia..', NULL, 50);
INSERT INTO disciplina VALUES (7, 'Hist√≥ria', 'Hist√≥ria √© a ci√™ncia que estuda o ser humano e sua a√ß√£o no tempo e no espa√ßo concomitantemente √† an√°lise de processos e eventos ocorridos no passado. O termo "Hist√≥ria" tamb√©m pode significar toda a informa√ß√£o do passado arquivada em todas as l√≠nguas por todo o mundo, por interm√©dio de registos hist√≥ricos.', NULL, 20);
INSERT INTO disciplina VALUES (8, 'Educa√ß√£o F√≠sica', 'Educa√ß√£o f√≠sica √© uma √°rea do conhecimento humano ligada √†s pr√°ticas corporais historicamente produzidas pela humanidade. A educa√ß√£o f√≠sica √© o processo pedag√≥gico que visa √† forma√ß√£o do homem capaz de se conduzir plenamente em suas atividades. Trabalha num sentido amplo, visando √† preven√ß√£o de determinadas doen√ßas.', NULL, 100);
INSERT INTO disciplina VALUES (9, 'Filosofia', 'Filosofia √© o estudo de quest√µes gerais e fundamentais[5][6][7] sobre a exist√™ncia, conhecimento, valores, raz√£o, mente, e linguagem; frequentemente colocadas como problemas[8][9] a se resolver. O termo provavelmente foi cunhado por Pit√°goras (c. 570  495 BCE). Os m√©todos filos√≥ficos incluem o questionamento, a discuss√£o cr√≠tica, o argumento racional e a apresenta√ß√£o sistem√°tica.[10] As quest√µes filos√≥ficas cl√°ssicas incluem: √â poss√≠vel saber qualquer coisa e provar que se sabe?[11][12][13] O que √© mais real? Os fil√≥sofos tamb√©m colocam quest√µes mais pr√°ticas e concretas, como: Existe uma maneira melhor de se viver? √â melhor ser justo ou injusto (se haver como se safar)? Os seres humanos t√™m livre arb√≠trio?', NULL, 40);
